    private Car Car { get; set; } = new Car();

    public string ButtonText { get; set; } = "Create";
    public string ButtonType { get; set; } = "btn-success";
    public int BrandId { get; set; }
    public IEnumerable<Brand> Brands { get; set; }
    public IEnumerable<CarModel> CarModels { get; set; }
    public IEnumerable<Owner> Owners { get; set; }
    public IEnumerable<Owner> Drivers { get; set; }

    [CascadingParameter]
    public int Id { get; set; }

    protected async override Task OnInitializedAsync()
    {
        Brands = await BrandRepository.GetAllAsync();
        BrandId = Brands.FirstOrDefault().BrandId;
        Owners = await OwnerRepository.GetAllAsync();
        Drivers = Owners.Where(o => o.OwnerType == Domain.Enums.OwnerEnum.DRIVER);


        if (Id != 0)
        {
            ButtonText = "Update";
            ButtonType = "btn-warning";
            Car = await CarRepository.FindAsync(Id);
            BrandId = Car.CarModel.BrandId;
            CarModels = await CarModelRepository.WhereAsync(c => c.Brand.BrandId == BrandId);
        }
        else
        {
            CarModels = await CarModelRepository.WhereAsync(c => c.Brand.BrandId == BrandId);

            Car.CarModel = CarModels.Where(cm => cm.Brand.BrandId == BrandId).FirstOrDefault();
            Car.Owner = Owners.FirstOrDefault();
            Car.Driver = Drivers.FirstOrDefault();

            Car.CarModelId = Car.CarModel.CarModelId;
            Car.OwnerId = Car.Owner.OwnerId;
            Car.DriverId = Car.Driver.OwnerId;
        }
    }

    async Task HandleValidSubmit()
    {
        if (Id != 0)
        {
            await CarRepository.UpdateAsync(Car);
        }
        else
        {
            await CarRepository.AddAsync(Car);
        }

    }

    async Task UpdateModelsAsync(int value)
    {
        BrandId = value;
        CarModels = await CarModelRepository.WhereAsync(c => c.Brand.BrandId == value);
    }

